B.Cf=new A.k4("Datenschutzerkl\xe4rung",null)
B.RP=new A.x("Wir freuen uns sehr \xfcber Ihr Interesse an unserem Unternehmen. Datenschutz hat einen besonders hohen Stellenwert f\xfcr die Gesch\xe4ftsleitung der Raumunikate Ina Kaiser. Eine Nutzung der Internetseiten der Raumunikate Ina Kaiser ist grunds\xe4tzlich ohne jede Angabe personenbezogener Daten m\xf6glich. Sofern eine betroffene Person besondere Services unseres Unternehmens \xfcber unsere Internetseite in Anspruch nehmen m\xf6chte, k\xf6nnte jedoch eine Verarbeitung personenbezogener Daten erforderlich werden. Ist die Verarbeitung personenbezogener Daten erforderlich und besteht f\xfcr eine solche Verarbeitung keine gesetzliche Grundlage, holen wir generell eine Einwilligung der betroffenen Person ein.",null,null,null,null,null,null,null)
B.Sm=new A.x("Die Verarbeitung personenbezogener Daten, beispielsweise des Namens, der Anschrift, E-Mail-Adresse oder Telefonnummer einer betroffenen Person, erfolgt stets im Einklang mit der Datenschutz-Grundverordnung und in \xdcbereinstimmung mit den f\xfcr die Raumunikate Ina Kaiser geltenden landesspezifischen Datenschutzbestimmungen. Mittels dieser Datenschutzerkl\xe4rung m\xf6chte unser Unternehmen die \xd6ffentlichkeit \xfcber Art, Umfang und Zweck der von uns erhobenen, genutzten und verarbeiteten personenbezogenen Daten informieren. Ferner werden betroffene Personen mittels dieser Datenschutzerkl\xe4rung \xfcber die ihnen zustehenden Rechte aufgekl\xe4rt",null,null,null,null,null,null,null)
B.QG=new A.x("Die Raumunikate Ina Kaiser hat als f\xfcr die Verarbeitung Verantwortlicher zahlreiche technische und organisatorische Ma\xdfnahmen umgesetzt, um einen m\xf6glichst l\xfcckenlosen Schutz der \xfcber diese Internetseite verarbeiteten personenbezogenen Daten sicherzustellen. Dennoch k\xf6nnen Internetbasierte Daten\xfcbertragungen grunds\xe4tzlich Sicherheitsl\xfccken aufweisen, sodass ein absoluter Schutz nicht gew\xe4hrleistet werden kann. Aus diesem Grund steht es jeder betroffenen Person frei, personenbezogene Daten auch auf alternativen Wegen, beispielsweise telefonisch, an uns zu \xfcbermitteln.",null,null,null,null,null,null,null)
B.T4=new A.x("1. Begriffsbestimmungen",null,null,null,null,null,null,null)
B.S5=new A.x("Die Datenschutzerkl\xe4rung der Raumunikate Ina Kaiser beruht auf den Begrifflichkeiten, die durch den Europ\xe4ischen Richtlinien- und Verordnungsgeber beim Erlass der Datenschutz-Grundverordnung (DS-GVO) verwendet wurden. Unsere Datenschutzerkl\xe4rung soll sowohl f\xfcr die \xd6ffentlichkeit als auch f\xfcr unsere Kunden und Gesch\xe4ftspartner einfach lesbar und verst\xe4ndlich sein. Um dies zu gew\xe4hrleisten, m\xf6chten wir vorab die verwendeten Begrifflichkeiten erl\xe4utern.",null,null,null,null,null,null,null)
B.Rk=new A.x("Wir verwenden in dieser Datenschutzerkl\xe4rung unter anderem die folgenden Begriffe:",null,null,null,null,null,null,null)
B.SG=new A.x("a)    personenbezogene Daten",null,null,null,null,null,null,null)
B.Ri=new A.x("Personenbezogene Daten sind alle Informationen, die sich auf eine identifizierte oder identifizierbare nat\xfcrliche Person (im Folgenden \u201ebetroffene Person\u201c) beziehen. Als identifizierbar wird eine nat\xfcrliche Person angesehen, die direkt oder indirekt, insbesondere mittels Zuordnung zu einer Kennung wie einem Namen, zu einer Kennnummer, zu Standortdaten, zu einer Online-Kennung oder zu einem oder mehreren besonderen Merkmalen, die Ausdruck der physischen, physiologischen, genetischen, psychischen, wirtschaftlichen, kulturellen oder sozialen Identit\xe4t dieser nat\xfcrlichen Person sind, identifiziert werden kann.",null,null,null,null,null,null,null)
B.RW=new A.x("b)    betroffene Person",null,null,null,null,null,null,null)
B.SL=new A.x("Betroffene Person ist jede identifizierte oder identifizierbare nat\xfcrliche Person, deren personenbezogene Daten von dem f\xfcr die Verarbeitung Verantwortlichen verarbeitet werden.",null,null,null,null,null,null,null)
B.RX=new A.x("c)    Verarbeitung",null,null,null,null,null,null,null)
B.Sq=new A.x("Verarbeitung ist jeder mit oder ohne Hilfe automatisierter Verfahren ausgef\xfchrte Vorgang oder jede solche Vorgangsreihe im Zusammenhang mit personenbezogenen Daten wie das Erheben, das Erfassen, die Organisation, das Ordnen, die Speicherung, die Anpassung oder Ver\xe4nderung, das Auslesen, das Abfragen, die Verwendung, die Offenlegung durch \xdcbermittlung, Verbreitung oder eine andere Form der Bereitstellung, den Abgleich oder die Verkn\xfcpfung, die Einschr\xe4nkung, das L\xf6schen oder die Vernichtung.",null,null,null,null,null,null,null)
B.T2=new A.x("d)    Einschr\xe4nkung der Verarbeitung",null,null,null,null,null,null,null)
B.SY=new A.x("Einschr\xe4nkung der Verarbeitung ist die Markierung gespeicherter personenbezogener Daten mit dem Ziel, ihre k\xfcnftige Verarbeitung einzuschr\xe4nken.",null,null,null,null,null,null,null)
B.R0=new A.x("e)    Profiling",null,null,null,null,null,null,null)
B.Sw=new A.x("Profiling ist jede Art der automatisierten Verarbeitung personenbezogener Daten, die darin besteht, dass diese personenbezogenen Daten verwendet werden, um bestimmte pers\xf6nliche Aspekte, die sich auf eine nat\xfcrliche Person beziehen, zu bewerten, insbesondere, um Aspekte bez\xfcglich Arbeitsleistung, wirtschaftlicher Lage, Gesundheit, pers\xf6nlicher Vorlieben, Interessen, Zuverl\xe4ssigkeit, Verhalten, Aufenthaltsort oder Ortswechsel dieser nat\xfcrlichen Person zu analysieren oder vorherzusagen.",null,null,null,null,null,null,null)
B.Tr=new A.x("f)    Pseudonymisierung",null,null,null,null,null,null,null)
B.T8=new A.x("Pseudonymisierung ist die Verarbeitung personenbezogener Daten in einer Weise, auf welche die personenbezogenen Daten ohne Hinzuziehung zus\xe4tzlicher Informationen nicht mehr einer spezifischen betroffenen Person zugeordnet werden k\xf6nnen, sofern diese zus\xe4tzlichen Informationen gesondert aufbewahrt werden und technischen und organisatorischen Ma\xdfnahmen unterliegen, die gew\xe4hrleisten, dass die personenbezogenen Daten nicht einer identifizierten oder identifizierbaren nat\xfcrlichen Person zugewiesen werden.",null,null,null,null,null,null,null)
B.QX=new A.x("g)    Verantwortlicher oder f\xfcr die Verarbeitung Verantwortlicher",null,null,null,null,null,null,null)
B.RR=new A.x("Verantwortlicher oder f\xfcr die Verarbeitung Verantwortlicher ist die nat\xfcrliche oder juristische Person, Beh\xf6rde, Einrichtung oder andere Stelle, die allein oder gemeinsam mit anderen \xfcber die Zwecke und Mittel der Verarbeitung von personenbezogenen Daten entscheidet. Sind die Zwecke und Mittel dieser Verarbeitung durch das Unionsrecht oder das Recht der Mitgliedstaaten vorgegeben, so kann der Verantwortliche beziehungsweise k\xf6nnen die bestimmten Kriterien seiner Benennung nach dem Unionsrecht oder dem Recht der Mitgliedstaaten vorgesehen werden.",null,null,null,null,null,null,null)
B.R6=new A.x("h)    Auftragsverarbeiter",null,null,null,null,null,null,null)
B.T9=new A.x("Auftragsverarbeiter ist eine nat\xfcrliche oder juristische Person, Beh\xf6rde, Einrichtung oder andere Stelle, die personenbezogene Daten im Auftrag des Verantwortlichen verarbeitet.",null,null,null,null,null,null,null)
B.Sv=new A.x("i)    Empf\xe4nger",null,null,null,null,null,null,null)
B.RU=new A.x("Empf\xe4nger ist eine nat\xfcrliche oder juristische Person, Beh\xf6rde, Einrichtung oder andere Stelle, der personenbezogene Daten offengelegt werden, unabh\xe4ngig davon, ob es sich bei ihr um einen Dritten handelt oder nicht. Beh\xf6rden, die im Rahmen eines bestimmten Untersuchungsauftrags nach dem Unionsrecht oder dem Recht der Mitgliedstaaten m\xf6glicherweise personenbezogene Daten erhalten, gelten jedoch nicht als Empf\xe4nger.",null,null,null,null,null,null,null)
B.Rx=new A.x("j)    Dritter",null,null,null,null,null,null,null)
B.Tv=new A.x("Dritter ist eine nat\xfcrliche oder juristische Person, Beh\xf6rde, Einrichtung oder andere Stelle au\xdfer der betroffenen Person, dem Verantwortlichen, dem Auftragsverarbeiter und den Personen, die unter der unmittelbaren Verantwortung des Verantwortlichen oder des Auftragsverarbeiters befugt sind, die personenbezogenen Daten zu verarbeiten.",null,null,null,null,null,null,null)
B.TD=new A.x("k)    Einwilligung",null,null,null,null,null,null,null)
B.S6=new A.x("Einwilligung ist jede von der betroffenen Person freiwillig f\xfcr den bestimmten Fall in informierter Weise und unmissverst\xe4ndlich abgegebene Willensbekundung in Form einer Erkl\xe4rung oder einer sonstigen eindeutigen best\xe4tigenden Handlung, mit der die betroffene Person zu verstehen gibt, dass sie mit der Verarbeitung der sie betreffenden personenbezogenen Daten einverstanden ist.",null,null,null,null,null,null,null)
B.S2=new A.x("2. Name und Anschrift des f\xfcr die Verarbeitung Verantwortlichen",null,null,null,null,null,null,null)
B.Ra=new A.x("Verantwortlicher im Sinne der Datenschutz-Grundverordnung, sonstiger in den Mitgliedstaaten der Europ\xe4ischen Union geltenden Datenschutzgesetze und anderer Bestimmungen mit datenschutzrechtlichem Charakter ist die:",null,null,null,null,null,null,null)
B.xa=new A.x("RAUMUNIKATE",null,null,null,null,null,null,null)
B.QQ=new A.x("3. Cookies",null,null,null,null,null,null,null)
B.R8=new A.x("Die Internetseiten der Raumunikate Ina Kaiser verwenden Cookies. Cookies sind Textdateien, welche \xfcber einen Internetbrowser auf einem Computersystem abgelegt und gespeichert werden.",null,null,null,null,null,null,null)
B.RI=new A.x("Zahlreiche Internetseiten und Server verwenden Cookies. Viele Cookies enthalten eine sogenannte Cookie-ID. Eine Cookie-ID ist eine eindeutige Kennung des Cookies. Sie besteht aus einer Zeichenfolge, durch welche Internetseiten und Server dem konkreten Internetbrowser zugeordnet werden k\xf6nnen, in dem das Cookie gespeichert wurde. Dies erm\xf6glicht es den besuchten Internetseiten und Servern, den individuellen Browser der betroffenen Person von anderen Internetbrowsern, die andere Cookies enthalten, zu unterscheiden. Ein bestimmter Internetbrowser kann \xfcber die eindeutige Cookie-ID wiedererkannt und identifiziert werden.",null,null,null,null,null,null,null)
B.QI=new A.x("Durch den Einsatz von Cookies kann die Raumunikate Ina Kaiser den Nutzern dieser Internetseite nutzerfreundlichere Services bereitstellen, die ohne die Cookie-Setzung nicht m\xf6glich w\xe4ren.",null,null,null,null,null,null,null)
B.Tw=new A.x("Mittels eines Cookies k\xf6nnen die Informationen und Angebote auf unserer Internetseite im Sinne des Benutzers optimiert werden. Cookies erm\xf6glichen uns, wie bereits erw\xe4hnt, die Benutzer unserer Internetseite wiederzuerkennen. Zweck dieser Wiedererkennung ist es, den Nutzern die Verwendung unserer Internetseite zu erleichtern. Der Benutzer einer Internetseite, die Cookies verwendet, muss beispielsweise nicht bei jedem Besuch der Internetseite erneut seine Zugangsdaten eingeben, weil dies von der Internetseite und dem auf dem Computersystem des Benutzers abgelegten Cookie \xfcbernommen wird. Ein weiteres Beispiel ist das Cookie eines Warenkorbes im Online-Shop. Der Online-Shop merkt sich die Artikel, die ein Kunde in den virtuellen Warenkorb gelegt hat, \xfcber ein Cookie.",null,null,null,null,null,null,null)
B.QJ=new A.x("Die betroffene Person kann die Setzung von Cookies durch unsere Internetseite jederzeit mittels einer entsprechenden Einstellung des genutzten Internetbrowsers verhindern und damit der Setzung von Cookies dauerhaft widersprechen. Ferner k\xf6nnen bereits gesetzte Cookies jederzeit \xfcber einen Internetbrowser oder andere Softwareprogramme gel\xf6scht werden. Dies ist in allen g\xe4ngigen Internetbrowsern m\xf6glich. Deaktiviert die betroffene Person die Setzung von Cookies in dem genutzten Internetbrowser, sind unter Umst\xe4nden nicht alle Funktionen unserer Internetseite vollumf\xe4nglich nutzbar.",null,null,null,null,null,null,null)
B.RL=new A.x("4. Erfassung von allgemeinen Daten und Informationen",null,null,null,null,null,null,null)
B.TG=new A.x("Die Internetseite der Raumunikate Ina Kaiser erfasst mit jedem Aufruf der Internetseite durch eine betroffene Person oder ein automatisiertes System eine Reihe von allgemeinen Daten und Informationen. Diese allgemeinen Daten und Informationen werden in den Logfiles des Servers gespeichert. Erfasst werden k\xf6nnen die (1) verwendeten Browsertypen und Versionen, (2) das vom zugreifenden System verwendete Betriebssystem, (3) die Internetseite, von welcher ein zugreifendes System auf unsere Internetseite gelangt (sogenannte Referrer), (4) die Unterwebseiten, welche \xfcber ein zugreifendes System auf unserer Internetseite angesteuert werden, (5) das Datum und die Uhrzeit eines Zugriffs auf die Internetseite, (6) eine Internet-Protokoll-Adresse (IP-Adresse), (7) der Internet-Service-Provider des zugreifenden Systems und (8) sonstige \xe4hnliche Daten und Informationen, die der Gefahrenabwehr im Falle von Angriffen auf unsere informationstechnologischen Systeme dienen.",null,null,null,null,null,null,null)
B.QN=new A.x("Bei der Nutzung dieser allgemeinen Daten und Informationen zieht die Raumunikate Ina Kaiser keine R\xfcckschl\xfcsse auf die betroffene Person. Diese Informationen werden vielmehr ben\xf6tigt, um (1) die Inhalte unserer Internetseite korrekt auszuliefern, (2) die Inhalte unserer Internetseite sowie die Werbung f\xfcr diese zu optimieren, (3) die dauerhafte Funktionsf\xe4higkeit unserer informationstechnologischen Systeme und der Technik unserer Internetseite zu gew\xe4hrleisten sowie (4) um Strafverfolgungsbeh\xf6rden im Falle eines Cyberangriffes die zur Strafverfolgung notwendigen Informationen bereitzustellen. Diese anonym erhobenen Daten und Informationen werden durch die Raumunikate Ina Kaiser daher einerseits statistisch und ferner mit dem Ziel ausgewertet, den Datenschutz und die Datensicherheit in unserem Unternehmen zu erh\xf6hen, um letztlich ein optimales Schutzniveau f\xfcr die von uns verarbeiteten personenbezogenen Daten sicherzustellen. Die anonymen Daten der Server-Logfiles werden getrennt von allen durch eine betroffene Person angegebenen personenbezogenen Daten gespeichert.",null,null,null,null,null,null,null)
B.Tt=new A.x("5. Registrierung auf unserer Internetseite",null,null,null,null,null,null,null)
B.Ty=new A.x("Die betroffene Person hat die M\xf6glichkeit, sich auf der Internetseite des f\xfcr die Verarbeitung Verantwortlichen unter Angabe von personenbezogenen Daten zu registrieren. Welche personenbezogenen Daten dabei an den f\xfcr die Verarbeitung Verantwortlichen \xfcbermittelt werden, ergibt sich aus der jeweiligen Eingabemaske, die f\xfcr die Registrierung verwendet wird. Die von der betroffenen Person eingegebenen personenbezogenen Daten werden ausschlie\xdflich f\xfcr die interne Verwendung bei dem f\xfcr die Verarbeitung Verantwortlichen und f\xfcr eigene Zwecke erhoben und gespeichert. Der f\xfcr die Verarbeitung Verantwortliche kann die Weitergabe an einen oder mehrere Auftragsverarbeiter, beispielsweise einen Paketdienstleister, veranlassen, der die personenbezogenen Daten ebenfalls ausschlie\xdflich f\xfcr eine interne Verwendung, die dem f\xfcr die Verarbeitung Verantwortlichen zuzurechnen ist, nutzt.",null,null,null,null,null,null,null)
B.Tf=new A.x("Durch eine Registrierung auf der Internetseite des f\xfcr die Verarbeitung Verantwortlichen wird ferner die vom Internet-Service-Provider (ISP) der betroffenen Person vergebene IP-Adresse, das Datum sowie die Uhrzeit der Registrierung gespeichert. Die Speicherung dieser Daten erfolgt vor dem Hintergrund, dass nur so der Missbrauch unserer Dienste verhindert werden kann, und diese Daten im Bedarfsfall erm\xf6glichen, begangene Straftaten aufzukl\xe4ren. Insofern ist die Speicherung dieser Daten zur Absicherung des f\xfcr die Verarbeitung Verantwortlichen erforderlich. Eine Weitergabe dieser Daten an Dritte erfolgt grunds\xe4tzlich nicht, sofern keine gesetzliche Pflicht zur Weitergabe besteht oder die Weitergabe der Strafverfolgung dient.",null,null,null,null,null,null,null)
B.R9=new A.x("Die Registrierung der betroffenen Person unter freiwilliger Angabe personenbezogener Daten dient dem f\xfcr die Verarbeitung Verantwortlichen dazu, der betroffenen Person Inhalte oder Leistungen anzubieten, die aufgrund der Natur der Sache nur registrierten Benutzern angeboten werden k\xf6nnen. Registrierten Personen steht die M\xf6glichkeit frei, die bei der Registrierung angegebenen personenbezogenen Daten jederzeit abzu\xe4ndern oder vollst\xe4ndig aus dem Datenbestand des f\xfcr die Verarbeitung Verantwortlichen l\xf6schen zu lassen.",null,null,null,null,null,null,null)
B.Ry=new A.x("Der f\xfcr die Verarbeitung Verantwortliche erteilt jeder betroffenen Person jederzeit auf Anfrage Auskunft dar\xfcber, welche personenbezogenen Daten \xfcber die betroffene Person gespeichert sind. Ferner berichtigt oder l\xf6scht der f\xfcr die Verarbeitung Verantwortliche personenbezogene Daten auf Wunsch oder Hinweis der betroffenen Person, soweit dem keine gesetzlichen Aufbewahrungspflichten entgegenstehen. Die Gesamtheit der Mitarbeiter des f\xfcr die Verarbeitung Verantwortlichen stehen der betroffenen Person in diesem Zusammenhang als Ansprechpartner zur Verf\xfcgung.",null,null,null,null,null,null,null)
B.Rp=new A.x("6. Kontaktm\xf6glichkeit \xfcber die Internetseite",null,null,null,null,null,null,null)
B.Sr=new A.x("Die Internetseite der Raumunikate Ina Kaiser enth\xe4lt aufgrund von gesetzlichen Vorschriften Angaben, die eine schnelle elektronische Kontaktaufnahme zu unserem Unternehmen sowie eine unmittelbare Kommunikation mit uns erm\xf6glichen, was ebenfalls eine allgemeine Adresse der sogenannten elektronischen Post (E-Mail-Adresse) umfasst. Sofern eine betroffene Person per E-Mail oder \xfcber ein Kontaktformular den Kontakt mit dem f\xfcr die Verarbeitung Verantwortlichen aufnimmt, werden die von der betroffenen Person \xfcbermittelten personenbezogenen Daten automatisch gespeichert. Solche auf freiwilliger Basis von einer betroffenen Person an den f\xfcr die Verarbeitung Verantwortlichen \xfcbermittelten personenbezogenen Daten werden f\xfcr Zwecke der Bearbeitung oder der Kontaktaufnahme zur betroffenen Person gespeichert. Es erfolgt keine Weitergabe dieser personenbezogenen Daten an Dritte.",null,null,null,null,null,null,null)
B.RV=new A.x("7. Routinem\xe4\xdfige L\xf6schung und Sperrung von personenbezogenen Daten",null,null,null,null,null,null,null)
B.RF=new A.x("Der f\xfcr die Verarbeitung Verantwortliche verarbeitet und speichert personenbezogene Daten der betroffenen Person nur f\xfcr den Zeitraum, der zur Erreichung des Speicherungszwecks erforderlich ist oder sofern dies durch den Europ\xe4ischen Richtlinien- und Verordnungsgeber oder einen anderen Gesetzgeber in Gesetzen oder Vorschriften, welchen der f\xfcr die Verarbeitung Verantwortliche unterliegt, vorgesehen wurde.",null,null,null,null,null,null,null)
B.To=new A.x("Entf\xe4llt der Speicherungszweck oder l\xe4uft eine vom Europ\xe4ischen Richtlinien- und Verordnungsgeber oder einem anderen zust\xe4ndigen Gesetzgeber vorgeschriebene Speicherfrist ab, werden die personenbezogenen Daten routinem\xe4\xdfig und entsprechend den gesetzlichen Vorschriften gesperrt oder gel\xf6scht.",null,null,null,null,null,null,null)
B.T6=new A.x("8. Rechte der betroffenen Person",null,null,null,null,null,null,null)
B.RG=new A.x("a)    Recht auf Best\xe4tigung",null,null,null,null,null,null,null)
B.Tm=new A.x("Jede betroffene Person hat das vom Europ\xe4ischen Richtlinien- und Verordnungsgeber einger\xe4umte Recht, von dem f\xfcr die Verarbeitung Verantwortlichen eine Best\xe4tigung dar\xfcber zu verlangen, ob sie betreffende personenbezogene Daten verarbeitet werden. M\xf6chte eine betroffene Person dieses Best\xe4tigungsrecht in Anspruch nehmen, kann sie sich hierzu jederzeit an einen Mitarbeiter des f\xfcr die Verarbeitung Verantwortlichen wenden.",null,null,null,null,null,null,null)
B.So=new A.x("b)    Recht auf Auskunft",null,null,null,null,null,null,null)
B.Qv=new A.x("Jede von der Verarbeitung personenbezogener Daten betroffene Person hat das vom Europ\xe4ischen Richtlinien- und Verordnungsgeber gew\xe4hrte Recht, jederzeit von dem f\xfcr die Verarbeitung Verantwortlichen unentgeltliche Auskunft \xfcber die zu seiner Person gespeicherten personenbezogenen Daten und eine Kopie dieser Auskunft zu erhalten. Ferner hat der Europ\xe4ische Richtlinien- und Verordnungsgeber der betroffenen Person Auskunft \xfcber folgende Informationen zugestanden:",null,null,null,null,null,null,null)
B.Qx=new A.x("- die Verarbeitungszwecke",null,null,null,null,null,null,null)
B.RS=new A.x("- die Kategorien personenbezogener Daten, die verarbeitet werden",null,null,null,null,null,null,null)
B.Tk=new A.x("- die Empf\xe4nger oder Kategorien von Empf\xe4ngern, gegen\xfcber denen die personenbezogenen Daten offengelegt worden sind oder noch offengelegt werden, insbesondere bei Empf\xe4ngern in Drittl\xe4ndern oder bei internationalen Organisationen",null,null,null,null,null,null,null)
B.RC=new A.x("- falls m\xf6glich die geplante Dauer, f\xfcr die die personenbezogenen Daten gespeichert werden, oder, falls dies nicht m\xf6glich ist, die Kriterien f\xfcr die Festlegung dieser Dauer",null,null,null,null,null,null,null)
B.RD=new A.x("- das Bestehen eines Rechts auf Berichtigung oder L\xf6schung der sie betreffenden personenbezogenen Daten oder auf Einschr\xe4nkung der Verarbeitung durch den Verantwortlichen oder eines Widerspruchsrechts gegen diese Verarbeitung",null,null,null,null,null,null,null)
B.Ts=new A.x("- das Bestehen eines Beschwerderechts bei einer Aufsichtsbeh\xf6rde",null,null,null,null,null,null,null)
B.Se=new A.x("- wenn die personenbezogenen Daten nicht bei der betroffenen Person erhoben werden: Alle verf\xfcgbaren Informationen \xfcber die Herkunft der Daten",null,null,null,null,null,null,null)
B.Rg=new A.x("- das Bestehen einer automatisierten Entscheidungsfindung einschlie\xdflich Profiling gem\xe4\xdf Artikel 22 Abs.1 und 4 DS-GVO und \u2014 zumindest in diesen F\xe4llen \u2014 aussagekr\xe4ftige Informationen \xfcber die involvierte Logik sowie die Tragweite und die angestrebten Auswirkungen einer derartigen Verarbeitung f\xfcr die betroffene Person",null,null,null,null,null,null,null)
B.Qt=new A.x("Ferner steht der betroffenen Person ein Auskunftsrecht dar\xfcber zu, ob personenbezogene Daten an ein Drittland oder an eine internationale Organisation \xfcbermittelt wurden. Sofern dies der Fall ist, so steht der betroffenen Person im \xdcbrigen das Recht zu, Auskunft \xfcber die geeigneten Garantien im Zusammenhang mit der \xdcbermittlung zu erhalten. M\xf6chte eine betroffene Person dieses Auskunftsrecht in Anspruch nehmen, kann sie sich hierzu jederzeit an einen Mitarbeiter des f\xfcr die Verarbeitung Verantwortlichen wenden.",null,null,null,null,null,null,null)
B.SS=new A.x("c)    Recht auf Berichtigung",null,null,null,null,null,null,null)
B.R2=new A.x("Jede von der Verarbeitung personenbezogener Daten betroffene Person hat das vom Europ\xe4ischen Richtlinien- und Verordnungsgeber gew\xe4hrte Recht, die unverz\xfcgliche Berichtigung sie betreffender unrichtiger personenbezogener Daten zu verlangen. Ferner steht der betroffenen Person das Recht zu, unter Ber\xfccksichtigung der Zwecke der Verarbeitung, die Vervollst\xe4ndigung unvollst\xe4ndiger personenbezogener Daten \u2014 auch mittels einer erg\xe4nzenden Erkl\xe4rung \u2014 zu verlangen.",null,null,null,null,null,null,null)
B.R3=new A.x("M\xf6chte eine betroffene Person dieses Berichtigungsrecht in Anspruch nehmen, kann sie sich hierzu jederzeit an einen Mitarbeiter des f\xfcr die Verarbeitung Verantwortlichen wenden.",null,null,null,null,null,null,null)
B.RJ=new A.x("d)    Recht auf L\xf6schung (Recht auf Vergessen werden)",null,null,null,null,null,null,null)
B.SJ=new A.x("Jede von der Verarbeitung personenbezogener Daten betroffene Person hat das vom Europ\xe4ischen Richtlinien- und Verordnungsgeber gew\xe4hrte Recht, von dem Verantwortlichen zu verlangen, dass die sie betreffenden personenbezogenen Daten unverz\xfcglich gel\xf6scht werden, sofern einer der folgenden Gr\xfcnde zutrifft und soweit die Verarbeitung nicht erforderlich ist:",null,null,null,null,null,null,null)
B.R7=new A.x("- Die personenbezogenen Daten wurden f\xfcr solche Zwecke erhoben oder auf sonstige Weise verarbeitet, f\xfcr welche sie nicht mehr notwendig sind.",null,null,null,null,null,null,null)
B.S9=new A.x("- Die betroffene Person widerruft ihre Einwilligung, auf die sich die Verarbeitung gem\xe4\xdf Art. 6 Abs. 1 Buchstabe a DS-GVO oder Art. 9 Abs. 2 Buchstabe a DS-GVO st\xfctzte, und es fehlt an einer anderweitigen Rechtsgrundlage f\xfcr die Verarbeitung.",null,null,null,null,null,null,null)
B.T7=new A.x("- Die betroffene Person legt gem\xe4\xdf Art. 21 Abs. 1 DS-GVO Widerspruch gegen die Verarbeitung ein, und es liegen keine vorrangigen berechtigten Gr\xfcnde f\xfcr die Verarbeitung vor, oder die betroffene Person legt gem\xe4\xdf Art. 21 Abs. 2 DS-GVO Widerspruch gegen die Verarbeitung ein.",null,null,null,null,null,null,null)
B.SO=new A.x("- Die personenbezogenen Daten wurden unrechtm\xe4\xdfig verarbeitet.",null,null,null,null,null,null,null)
B.S8=new A.x("- Die L\xf6schung der personenbezogenen Daten ist zur Erf\xfcllung einer rechtlichen Verpflichtung nach dem Unionsrecht oder dem Recht der Mitgliedstaaten erforderlich, dem der Verantwortliche unterliegt.",null,null,null,null,null,null,null)
B.Sa=new A.x("- Die personenbezogenen Daten wurden in Bezug auf angebotene Dienste der Informationsgesellschaft gem\xe4\xdf Art. 8 Abs. 1 DS-GVO erhoben.",null,null,null,null,null,null,null)
B.TN=new A.x("Sofern einer der oben genannten Gr\xfcnde zutrifft und eine betroffene Person die L\xf6schung von personenbezogenen Daten, die bei der Raumunikate Ina Kaiser gespeichert sind, veranlassen m\xf6chte, kann sie sich hierzu jederzeit an einen Mitarbeiter des f\xfcr die Verarbeitung Verantwortlichen wenden. Der Mitarbeiter der Raumunikate Ina Kaiser wird veranlassen, dass dem L\xf6schverlangen unverz\xfcglich nachgekommen wird. Wurden die personenbezogenen Daten von der Raumunikate Ina Kaiser \xf6ffentlich gemacht und ist unser Unternehmen als Verantwortlicher gem\xe4\xdf Art. 17 Abs. 1 DS-GVO zur L\xf6schung der personenbezogenen Daten verpflichtet, so trifft die Raumunikate Ina Kaiser unter Ber\xfccksichtigung der verf\xfcgbaren Technologie und der Implementierungskosten angemessene Ma\xdfnahmen, auch technischer Art, um andere f\xfcr die Datenverarbeitung Verantwortliche, welche die ver\xf6ffentlichten personenbezogenen Daten verarbeiten, dar\xfcber in Kenntnis zu setzen, dass die betroffene Person von diesen anderen f\xfcr die Datenverarbeitung Verantwortlichen die L\xf6schung s\xe4mtlicher Links zu diesen personenbezogenen Daten oder von Kopien oder Replikationen dieser personenbezogenen Daten verlangt hat, soweit die Verarbeitung nicht erforderlich ist. Der Mitarbeiter der Raumunikate Ina Kaiser wird im Einzelfall das Notwendige veranlassen.",null,null,null,null,null,null,null)
B.Rn=new A.x("e)    Recht auf Einschr\xe4nkung der Verarbeitung",null,null,null,null,null,null,null)
B.QZ=new A.x("Jede von der Verarbeitung personenbezogener Daten betroffene Person hat das vom Europ\xe4ischen Richtlinien- und Verordnungsgeber gew\xe4hrte Recht, von dem Verantwortlichen die Einschr\xe4nkung der Verarbeitung zu verlangen, wenn eine der folgenden Voraussetzungen gegeben ist:",null,null,null,null,null,null,null)
B.SE=new A.x("- Die Richtigkeit der personenbezogenen Daten wird von der betroffenen Person bestritten, und zwar f\xfcr eine Dauer, die es dem Verantwortlichen erm\xf6glicht, die Richtigkeit der personenbezogenen Daten zu \xfcberpr\xfcfen.",null,null,null,null,null,null,null)
B.QW=new A.x("- Die Verarbeitung ist unrechtm\xe4\xdfig, die betroffene Person lehnt die L\xf6schung der personenbezogenen Daten ab und verlangt stattdessen die Einschr\xe4nkung der Nutzung der personenbezogenen Daten.",null,null,null,null,null,null,null)
B.Rv=new A.x("- Der Verantwortliche ben\xf6tigt die personenbezogenen Daten f\xfcr die Zwecke der Verarbeitung nicht l\xe4nger, die betroffene Person ben\xf6tigt sie jedoch zur Geltendmachung, Aus\xfcbung oder Verteidigung von Rechtsanspr\xfcchen.",null,null,null,null,null,null,null)
B.Ro=new A.x("- Die betroffene Person hat Widerspruch gegen die Verarbeitung gem. Art. 21 Abs. 1 DS-GVO eingelegt und es steht noch nicht fest, ob die berechtigten Gr\xfcnde des Verantwortlichen gegen\xfcber denen der betroffenen Person \xfcberwiegen.",null,null,null,null,null,null,null)
B.RM=new A.x("Sofern eine der oben genannten Voraussetzungen gegeben ist und eine betroffene Person die Einschr\xe4nkung von personenbezogenen Daten, die bei der Raumunikate Ina Kaiser gespeichert sind, verlangen m\xf6chte, kann sie sich hierzu jederzeit an einen Mitarbeiter des f\xfcr die Verarbeitung Verantwortlichen wenden. Der Mitarbeiter der Raumunikate Ina Kaiser wird die Einschr\xe4nkung der Verarbeitung veranlassen.",null,null,null,null,null,null,null)
B.TK=new A.x("f)    Recht auf Daten\xfcbertragbarkeit",null,null,null,null,null,null,null)
B.T1=new A.x("Jede von der Verarbeitung personenbezogener Daten betroffene Person hat das vom Europ\xe4ischen Richtlinien- und Verordnungsgeber gew\xe4hrte Recht, die sie betreffenden personenbezogenen Daten, welche durch die betroffene Person einem Verantwortlichen bereitgestellt wurden, in einem strukturierten, g\xe4ngigen und maschinenlesbaren Format zu erhalten. Sie hat au\xdferdem das Recht, diese Daten einem anderen Verantwortlichen ohne Behinderung durch den Verantwortlichen, dem die personenbezogenen Daten bereitgestellt wurden, zu \xfcbermitteln, sofern die Verarbeitung auf der Einwilligung gem\xe4\xdf Art. 6 Abs. 1 Buchstabe a DS-GVO oder Art. 9 Abs. 2 Buchstabe a DS-GVO oder auf einem Vertrag gem\xe4\xdf Art. 6 Abs. 1 Buchstabe b DS-GVO beruht und die Verarbeitung mithilfe automatisierter Verfahren erfolgt, sofern die Verarbeitung nicht f\xfcr die Wahrnehmung einer Aufgabe erforderlich ist, die im \xf6ffentlichen Interesse liegt oder in Aus\xfcbung \xf6ffentlicher Gewalt erfolgt, welche dem Verantwortlichen \xfcbertragen wurde.",null,null,null,null,null,null,null)
B.QB=new A.x("Ferner hat die betroffene Person bei der Aus\xfcbung ihres Rechts auf Daten\xfcbertragbarkeit gem\xe4\xdf Art. 20 Abs. 1 DS-GVO das Recht, zu erwirken, dass die personenbezogenen Daten direkt von einem Verantwortlichen an einen anderen Verantwortlichen \xfcbermittelt werden, soweit dies technisch machbar ist und sofern hiervon nicht die Rechte und Freiheiten anderer Personen beeintr\xe4chtigt werden.",null,null,null,null,null,null,null)
B.Tq=new A.x("Zur Geltendmachung des Rechts auf Daten\xfcbertragbarkeit kann sich die betroffene Person jederzeit an einen Mitarbeiter der Raumunikate Ina Kaiser wenden.",null,null,null,null,null,null,null)
B.Tn=new A.x("g)    Recht auf Widerspruch",null,null,null,null,null,null,null)
B.Rr=new A.x("Jede von der Verarbeitung personenbezogener Daten betroffene Person hat das vom Europ\xe4ischen Richtlinien- und Verordnungsgeber gew\xe4hrte Recht, aus Gr\xfcnden, die sich aus ihrer besonderen Situation ergeben, jederzeit gegen die Verarbeitung sie betreffender personenbezogener Daten, die aufgrund von Art. 6 Abs. 1 Buchstaben e oder f DS-GVO erfolgt, Widerspruch einzulegen. Dies gilt auch f\xfcr ein auf diese Bestimmungen gest\xfctztes Profiling.",null,null,null,null,null,null,null)
B.QV=new A.x("Die Raumunikate Ina Kaiser verarbeitet die personenbezogenen Daten im Falle des Widerspruchs nicht mehr, es sei denn, wir k\xf6nnen zwingende schutzw\xfcrdige Gr\xfcnde f\xfcr die Verarbeitung nachweisen, die den Interessen, Rechten und Freiheiten der betroffenen Person \xfcberwiegen, oder die Verarbeitung dient der Geltendmachung, Aus\xfcbung oder Verteidigung von Rechtsanspr\xfcchen.",null,null,null,null,null,null,null)
B.QP=new A.x("Verarbeitet die Raumunikate Ina Kaiser personenbezogene Daten, um Direktwerbung zu betreiben, so hat die betroffene Person das Recht, jederzeit Widerspruch gegen die Verarbeitung der personenbezogenen Daten zum Zwecke derartiger Werbung einzulegen. Dies gilt auch f\xfcr das Profiling, soweit es mit solcher Direktwerbung in Verbindung steht. Widerspricht die betroffene Person gegen\xfcber der Raumunikate Ina Kaiser der Verarbeitung f\xfcr Zwecke der Direktwerbung, so wird die Raumunikate Ina Kaiser die personenbezogenen Daten nicht mehr f\xfcr diese Zwecke verarbeiten.",null,null,null,null,null,null,null)
B.Qz=new A.x("Zudem hat die betroffene Person das Recht, aus Gr\xfcnden, die sich aus ihrer besonderen Situation ergeben, gegen die sie betreffende Verarbeitung personenbezogener Daten, die bei der Raumunikate Ina Kaiser zu wissenschaftlichen oder historischen Forschungszwecken oder zu statistischen Zwecken gem\xe4\xdf Art. 89 Abs. 1 DS-GVO erfolgen, Widerspruch einzulegen, es sei denn, eine solche Verarbeitung ist zur Erf\xfcllung einer im \xf6ffentlichen Interesse liegenden Aufgabe erforderlich.",null,null,null,null,null,null,null)
B.SV=new A.x("Zur Aus\xfcbung des Rechts auf Widerspruch kann sich die betroffene Person direkt an jeden Mitarbeiter der Raumunikate Ina Kaiser oder einen anderen Mitarbeiter wenden. Der betroffenen Person steht es ferner frei, im Zusammenhang mit der Nutzung von Diensten der Informationsgesellschaft, ungeachtet der Richtlinie 2002/58/EG, ihr Widerspruchsrecht mittels automatisierter Verfahren auszu\xfcben, bei denen technische Spezifikationen verwendet werden.",null,null,null,null,null,null,null)
B.Sd=new A.x("h)    Automatisierte Entscheidungen im Einzelfall einschlie\xdflich Profiling",null,null,null,null,null,null,null)
B.QD=new A.x("Jede von der Verarbeitung personenbezogener Daten betroffene Person hat das vom Europ\xe4ischen Richtlinien- und Verordnungsgeber gew\xe4hrte Recht, nicht einer ausschlie\xdflich auf einer automatisierten Verarbeitung \u2014 einschlie\xdflich Profiling \u2014 beruhenden Entscheidung unterworfen zu werden, die ihr gegen\xfcber rechtliche Wirkung entfaltet oder sie in \xe4hnlicher Weise erheblich beeintr\xe4chtigt, sofern die Entscheidung (1) nicht f\xfcr den Abschluss oder die Erf\xfcllung eines Vertrags zwischen der betroffenen Person und dem Verantwortlichen erforderlich ist, oder (2) aufgrund von Rechtsvorschriften der Union oder der Mitgliedstaaten, denen der Verantwortliche unterliegt, zul\xe4ssig ist und diese Rechtsvorschriften angemessene Ma\xdfnahmen zur Wahrung der Rechte und Freiheiten sowie der berechtigten Interessen der betroffenen Person enthalten oder (3) mit ausdr\xfccklicher Einwilligung der betroffenen Person erfolgt.",null,null,null,null,null,null,null)
B.TM=new A.x("Ist die Entscheidung (1) f\xfcr den Abschluss oder die Erf\xfcllung eines Vertrags zwischen der betroffenen Person und dem Verantwortlichen erforderlich oder (2) erfolgt sie mit ausdr\xfccklicher Einwilligung der betroffenen Person, trifft die Raumunikate Ina Kaiser angemessene Ma\xdfnahmen, um die Rechte und Freiheiten sowie die berechtigten Interessen der betroffenen Person zu wahren, wozu mindestens das Recht auf Erwirkung des Eingreifens einer Person seitens des Verantwortlichen, auf Darlegung des eigenen Standpunkts und auf Anfechtung der Entscheidung geh\xf6rt.",null,null,null,null,null,null,null)
B.S4=new A.x("M\xf6chte die betroffene Person Rechte mit Bezug auf automatisierte Entscheidungen geltend machen, kann sie sich hierzu jederzeit an einen Mitarbeiter des f\xfcr die Verarbeitung Verantwortlichen wenden.",null,null,null,null,null,null,null)
B.QF=new A.x("i)    Recht auf Widerruf einer datenschutzrechtlichen Einwilligung",null,null,null,null,null,null,null)
B.SZ=new A.x("Jede von der Verarbeitung personenbezogener Daten betroffene Person hat das vom Europ\xe4ischen Richtlinien- und Verordnungsgeber gew\xe4hrte Recht, eine Einwilligung zur Verarbeitung personenbezogener Daten jederzeit zu widerrufen.",null,null,null,null,null,null,null)
B.Tg=new A.x("M\xf6chte die betroffene Person ihr Recht auf Widerruf einer Einwilligung geltend machen, kann sie sich hierzu jederzeit an einen Mitarbeiter des f\xfcr die Verarbeitung Verantwortlichen wenden.",null,null,null,null,null,null,null)
B.Td=new A.x("9. Datenschutzbestimmungen zu Einsatz und Verwendung von Facebook",null,null,null,null,null,null,null)
B.SF=new A.x("Der f\xfcr die Verarbeitung Verantwortliche hat auf dieser Internetseite Komponenten des Unternehmens Facebook integriert. Facebook ist ein soziales Netzwerk.",null,null,null,null,null,null,null)
B.Rf=new A.x("Ein soziales Netzwerk ist ein im Internet betriebener sozialer Treffpunkt, eine Online-Gemeinschaft, die es den Nutzern in der Regel erm\xf6glicht, untereinander zu kommunizieren und im virtuellen Raum zu interagieren. Ein soziales Netzwerk kann als Plattform zum Austausch von Meinungen und Erfahrungen dienen oder erm\xf6glicht es der Internetgemeinschaft, pers\xf6nliche oder unternehmensbezogene Informationen bereitzustellen. Facebook erm\xf6glicht den Nutzern des sozialen Netzwerkes unter anderem die Erstellung von privaten Profilen, den Upload von Fotos und eine Vernetzung \xfcber Freundschaftsanfragen.",null,null,null,null,null,null,null)
B.S_=new A.x("Betreibergesellschaft von Facebook ist die Facebook, Inc., 1 Hacker Way, Menlo Park, CA 94025, USA. F\xfcr die Verarbeitung personenbezogener Daten Verantwortlicher ist, wenn eine betroffene Person au\xdferhalb der USA oder Kanada lebt, die Facebook Ireland Ltd., 4 Grand Canal Square, Grand Canal Harbour, Dublin 2, Ireland.",null,null,null,null,null,null,null)
B.Tp=new A.x("Durch jeden Aufruf einer der Einzelseiten dieser Internetseite, die durch den f\xfcr die Verarbeitung Verantwortlichen betrieben wird und auf welcher eine Facebook-Komponente (Facebook-Plug-In) integriert wurde, wird der Internetbrowser auf dem informationstechnologischen System der betroffenen Person automatisch durch die jeweilige Facebook-Komponente veranlasst, eine Darstellung der entsprechenden Facebook-Komponente von Facebook herunterzuladen. Eine Gesamt\xfcbersicht \xfcber alle Facebook-Plug-Ins kann unter https://developers.facebook.com/docs/plugins/?locale=de_DE abgerufen werden. Im Rahmen dieses technischen Verfahrens erh\xe4lt Facebook Kenntnis dar\xfcber, welche konkrete Unterseite unserer Internetseite durch die betroffene Person besucht wird.",null,null,null,null,null,null,null)
B.S0=new A.x("Sofern die betroffene Person gleichzeitig bei Facebook eingeloggt ist, erkennt Facebook mit jedem Aufruf unserer Internetseite durch die betroffene Person und w\xe4hrend der gesamten Dauer des jeweiligen Aufenthaltes auf unserer Internetseite, welche konkrete Unterseite unserer Internetseite die betroffene Person besucht. Diese Informationen werden durch die Facebook-Komponente gesammelt und durch Facebook dem jeweiligen Facebook-Account der betroffenen Person zugeordnet. Bet\xe4tigt die betroffene Person einen der auf unserer Internetseite integrierten Facebook-Buttons, beispielsweise den \u201eGef\xe4llt mir\u201c-Button, oder gibt die betroffene Person einen Kommentar ab, ordnet Facebook diese Information dem pers\xf6nlichen Facebook-Benutzerkonto der betroffenen Person zu und speichert diese personenbezogenen Daten.",null,null,null,null,null,null,null)
B.RQ=new A.x("Facebook erh\xe4lt \xfcber die Facebook-Komponente immer dann eine Information dar\xfcber, dass die betroffene Person unsere Internetseite besucht hat, wenn die betroffene Person zum Zeitpunkt des Aufrufs unserer Internetseite gleichzeitig bei Facebook eingeloggt ist; dies findet unabh\xe4ngig davon statt, ob die betroffene Person die Facebook-Komponente anklickt oder nicht. Ist eine derartige \xdcbermittlung dieser Informationen an Facebook von der betroffenen Person nicht gewollt, kann diese die \xdcbermittlung dadurch verhindern, dass sie sich vor einem Aufruf unserer Internetseite aus ihrem Facebook-Account ausloggt.",null,null,null,null,null,null,null)
B.Dc=new A.ba("Die von Facebook ver\xf6ffentlichte Datenrichtlinie, die unter ",null)
B.D5=new A.ba("https://de-de.facebook.com/privacy/policy","https://de-de.facebook.com/privacy/policy/")
B.Di=new A.ba(" abrufbar ist, gibt Aufschluss \xfcber die Erhebung, Verarbeitung und Nutzung personenbezogener Daten durch Facebook. Ferner wird dort erl\xe4utert, welche Einstellungsm\xf6glichkeiten Facebook zum Schutz der Privatsph\xe4re der betroffenen Person bietet. Zudem sind unterschiedliche Applikationen erh\xe4ltlich, die es erm\xf6glichen, eine Daten\xfcbermittlung an Facebook zu unterdr\xfccken. Solche Applikationen k\xf6nnen durch die betroffene Person genutzt werden, um eine Daten\xfcbermittlung an Facebook zu unterdr\xfccken.",null)
B.FU=A.a(s([B.Dc,B.D5,B.Di]),t.R)
