B.Su=new A.x("Der f\xfcr die Verarbeitung Verantwortliche hat auf dieser Internetseite Komponenten von PayPal integriert. PayPal ist ein Online-Zahlungsdienstleister. Zahlungen werden \xfcber sogenannte PayPal-Konten abgewickelt, die virtuelle Privat- oder Gesch\xe4ftskonten darstellen. Zudem besteht bei PayPal die M\xf6glichkeit, virtuelle Zahlungen \xfcber Kreditkarten abzuwickeln, wenn ein Nutzer kein PayPal-Konto unterh\xe4lt. Ein PayPal-Konto wird \xfcber eine E-Mail-Adresse gef\xfchrt, weshalb es keine klassische Kontonummer gibt. PayPal erm\xf6glicht es, Online-Zahlungen an Dritte auszul\xf6sen oder auch Zahlungen zu empfangen. PayPal \xfcbernimmt ferner Treuh\xe4nderfunktionen und bietet K\xe4uferschutzdienste an.",null,null,null,null,null,null,null)
B.RY=new A.x("Die Europ\xe4ische Betreibergesellschaft von PayPal ist die PayPal (Europe) S.\xe0.r.l. et Cie, S.C.A., 22-24 Boulevard Royal L-2449, Luxemburg.",null,null,null,null,null,null,null)
B.Sg=new A.x("W\xe4hlt die betroffene Person w\xe4hrend des Bestellvorgangs in unserem Online-Shop als Zahlungsm\xf6glichkeit \u201ePayPal\u201c aus, werden automatisiert Daten der betroffenen Person an PayPal \xfcbermittelt. Mit der Auswahl dieser Zahlungsoption willigt die betroffene Person in die zur Zahlungsabwicklung erforderliche \xdcbermittlung personenbezogener Daten ein.",null,null,null,null,null,null,null)
B.ST=new A.x("Bei den an PayPal \xfcbermittelten personenbezogenen Daten handelt es sich in der Regel um Vorname, Nachname, Adresse, Email-Adresse, IP-Adresse, Telefonnummer, Mobiltelefonnummer oder andere Daten, die zur Zahlungsabwicklung notwendig sind. Zur Abwicklung des Kaufvertrages notwendig sind auch solche personenbezogenen Daten, die im Zusammenhang mit der jeweiligen Bestellung stehen.",null,null,null,null,null,null,null)
B.RK=new A.x("Die \xdcbermittlung der Daten bezweckt die Zahlungsabwicklung und die Betrugspr\xe4vention. Der f\xfcr die Verarbeitung Verantwortliche wird PayPal personenbezogene Daten insbesondere dann \xfcbermitteln, wenn ein berechtigtes Interesse f\xfcr die \xdcbermittlung gegeben ist. Die zwischen PayPal und dem f\xfcr die Verarbeitung Verantwortlichen ausgetauschten personenbezogenen Daten werden von PayPal unter Umst\xe4nden an Wirtschaftsauskunfteien \xfcbermittelt. Diese \xdcbermittlung bezweckt die Identit\xe4ts- und Bonit\xe4tspr\xfcfung.",null,null,null,null,null,null,null)
B.RO=new A.x("PayPal gibt die personenbezogenen Daten gegebenenfalls an verbundene Unternehmen und Leistungserbringer oder Subunternehmer weiter, soweit dies zur Erf\xfcllung der vertraglichen Verpflichtungen erforderlich ist oder die Daten im Auftrag verarbeitet werden sollen.",null,null,null,null,null,null,null)
B.QM=new A.x("Die betroffene Person hat die M\xf6glichkeit, die Einwilligung zum Umgang mit personenbezogenen Daten jederzeit gegen\xfcber PayPal zu widerrufen. Ein Widerruf wirkt sich nicht auf personenbezogene Daten aus, die zwingend zur (vertragsgem\xe4\xdfen) Zahlungsabwicklung verarbeitet, genutzt oder \xfcbermittelt werden m\xfcssen.",null,null,null,null,null,null,null)
B.Ti=new A.x("Die geltenden Datenschutzbestimmungen von PayPal k\xf6nnen unter https://www.paypal.com/de/webapps/mpp/ua/privacy-full abgerufen werden.",null,null,null,null,null,null,null)
B.SP=new A.x("12. Rechtsgrundlage der Verarbeitung",null,null,null,null,null,null,null)
B.R4=new A.x("Art. 6 I lit. a DS-GVO dient unserem Unternehmen als Rechtsgrundlage f\xfcr Verarbeitungsvorg\xe4nge, bei denen wir eine Einwilligung f\xfcr einen bestimmten Verarbeitungszweck einholen. Ist die Verarbeitung personenbezogener Daten zur Erf\xfcllung eines Vertrags, dessen Vertragspartei die betroffene Person ist, erforderlich, wie dies beispielsweise bei Verarbeitungsvorg\xe4ngen der Fall ist, die f\xfcr eine Lieferung von Waren oder die Erbringung einer sonstigen Leistung oder Gegenleistung notwendig sind, so beruht die Verarbeitung auf Art. 6 I lit. b DS-GVO. Gleiches gilt f\xfcr solche Verarbeitungsvorg\xe4nge die zur Durchf\xfchrung vorvertraglicher Ma\xdfnahmen erforderlich sind, etwa in F\xe4llen von Anfragen zur unseren Produkten oder Leistungen. Unterliegt unser Unternehmen einer rechtlichen Verpflichtung durch welche eine Verarbeitung von personenbezogenen Daten erforderlich wird, wie beispielsweise zur Erf\xfcllung steuerlicher Pflichten, so basiert die Verarbeitung auf Art. 6 I lit. c DS-GVO. In seltenen F\xe4llen k\xf6nnte die Verarbeitung von personenbezogenen Daten erforderlich werden, um lebenswichtige Interessen der betroffenen Person oder einer anderen nat\xfcrlichen Person zu sch\xfctzen. Dies w\xe4re beispielsweise der Fall, wenn ein Besucher in unserem Betrieb verletzt werden w\xfcrde und daraufhin sein Name, sein Alter, seine Krankenkassendaten oder sonstige lebenswichtige Informationen an einen Arzt, ein Krankenhaus oder sonstige Dritte weitergegeben werden m\xfcssten. Dann w\xfcrde die Verarbeitung auf Art. 6 I lit. d DS-GVO beruhen. Letztlich k\xf6nnten Verarbeitungsvorg\xe4nge auf Art. 6 I lit. f DS-GVO beruhen. Auf dieser Rechtsgrundlage basieren Verarbeitungsvorg\xe4nge, die von keiner der vorgenannten Rechtsgrundlagen erfasst werden, wenn die Verarbeitung zur Wahrung eines berechtigten Interesses unseres Unternehmens oder eines Dritten erforderlich ist, sofern die Interessen, Grundrechte und Grundfreiheiten des Betroffenen nicht \xfcberwiegen. Solche Verarbeitungsvorg\xe4nge sind uns insbesondere deshalb gestattet, weil sie durch den Europ\xe4ischen Gesetzgeber besonders erw\xe4hnt wurden. Er vertrat insoweit die Auffassung, dass ein berechtigtes Interesse anzunehmen sein k\xf6nnte, wenn die betroffene Person ein Kunde des Verantwortlichen ist (Erw\xe4gungsgrund 47 Satz 2 DS-GVO).",null,null,null,null,null,null,null)
