B.T_=new A.x("Basiert die Verarbeitung personenbezogener Daten auf Artikel 6 I lit. f DS-GVO ist unser berechtigtes Interesse die Durchf\xfchrung unserer Gesch\xe4ftst\xe4tigkeit zugunsten des Wohlergehens all unserer Mitarbeiter und unserer Anteilseigner.",null,null,null,null,null,null,null)
B.St=new A.x("14. Dauer, f\xfcr die die personenbezogenen Daten gespeichert werden",null,null,null,null,null,null,null)
B.Ru=new A.x("Das Kriterium f\xfcr die Dauer der Speicherung von personenbezogenen Daten ist die jeweilige gesetzliche Aufbewahrungsfrist. Nach Ablauf der Frist werden die entsprechenden Daten routinem\xe4\xdfig gel\xf6scht, sofern sie nicht mehr zur Vertragserf\xfcllung oder Vertragsanbahnung erforderlich sind.",null,null,null,null,null,null,null)
B.TI=new A.x("15. Gesetzliche oder vertragliche Vorschriften zur Bereitstellung der personenbezogenen Daten; Erforderlichkeit f\xfcr den Vertragsabschluss; Verpflichtung der betroffenen Person, die personenbezogenen Daten bereitzustellen; m\xf6gliche Folgen der Nichtbereitstellung",null,null,null,null,null,null,null)
B.SM=new A.x("Wir kl\xe4ren Sie dar\xfcber auf, dass die Bereitstellung personenbezogener Daten zum Teil gesetzlich vorgeschrieben ist (z.B. Steuervorschriften) oder sich auch aus vertraglichen Regelungen (z.B. Angaben zum Vertragspartner) ergeben kann. Mitunter kann es zu einem Vertragsschluss erforderlich sein, dass eine betroffene Person uns personenbezogene Daten zur Verf\xfcgung stellt, die in der Folge durch uns verarbeitet werden m\xfcssen. Die betroffene Person ist beispielsweise verpflichtet uns personenbezogene Daten bereitzustellen, wenn unser Unternehmen mit ihr einen Vertrag abschlie\xdft. Eine Nichtbereitstellung der personenbezogenen Daten h\xe4tte zur Folge, dass der Vertrag mit dem Betroffenen nicht geschlossen werden k\xf6nnte. Vor einer Bereitstellung personenbezogener Daten durch den Betroffenen muss sich der Betroffene an einen unserer Mitarbeiter wenden. Unser Mitarbeiter kl\xe4rt den Betroffenen einzelfallbezogen dar\xfcber auf, ob die Bereitstellung der personenbezogenen Daten gesetzlich oder vertraglich vorgeschrieben oder f\xfcr den Vertragsabschluss erforderlich ist, ob eine Verpflichtung besteht, die personenbezogenen Daten bereitzustellen, und welche Folgen die Nichtbereitstellung der personenbezogenen Daten h\xe4tte.",null,null,null,null,null,null,null)
